            const container = document.getElementById("main")

            let routeId, localeId, pathVariables, shouldHydrate = false
            if ("framerHydrateV2" in container.dataset) {
                const routeData = JSON.parse(container.dataset.framerHydrateV2)
                routeId = routeData.routeId
                localeId = routeData.localeId
                pathVariables = routeData.pathVariables
                shouldHydrate = true
            } else {
                const routeData = Framer.inferInitialRouteFromPath(routes, decodeURIComponent(location.pathname), true, locales)
                routeId = routeData.routeId
                localeId = routeData.localeId
                pathVariables = routeData.pathVariables
            }

            const route = routes[routeId]
            const RootComponent = await route.page.preload()
            routes[routeId].page = RootComponent

            const content = React.createElement(
                Framer.PageRoot,
                {
                    RootComponent,
                    isWebsite: true,
                    routeId,
                    pathVariables,
                    routes,
                    collectionUtils,
                    notFoundPage,
                    isReducedMotion: undefined,
                    localeId,
                    locales,
                }
            )

            const contentWithFeaturesContext = React.createElement(
                Framer.LibraryFeaturesProvider,
                {
                    children: content,
                    value: {imgSizesWorkaroundEnabled: false}
                }
            )


            const page = React.createElement(Framer.PageEffectsProvider, {
                children: contentWithFeaturesContext,
                value: {routes: {}}
            })

            if (shouldHydrate) {
                React.startTransition(() => {
                    ReactDOM.hydrateRoot(container, page)
                })
            } else {
                ReactDOM.createRoot(container).render(page)
            }
        })().catch(error => {
            window.__send_framer_event && window.__send_framer_event("published_site_load_error", {
                message: String(error),
                stack: error instanceof Error && typeof error.stack === "string" ? error.stack : null
            })
            throw error
        })

        
        ;(async () => {
            const { default: Badge } = await import("__framer-badge")
            const ContainerWithStyleAppearEffect = Framer.withStyleAppearEffect(Framer.Container)
            React.startTransition(() => {
                ReactDOM.createRoot(document.getElementById("__framer-badge-container"))
                    .render(React.createElement(ContainerWithStyleAppearEffect, {
                        className: "__framer-badge",
                        __framer__threshold: 0.5,
                        __framer__animateOnce: true,
                        __framer__opacity: 0,
                        __framer__targetOpacity: 1,
                        __framer__rotate: 0,
                        __framer__x: 0,
                        __framer__y: 10,
                        __framer__scale: 1,
                        __framer__transition: {
                            "type": "spring",
                            "ease": [0.44, 0, 0.56, 1],
                            "duration": 0.3,
                            "delay": 1,
                            "stiffness": 350,
                            "damping": 40,
                            "mass": 1.5
                        },
                        __framer__rotateX: 0,
                        __framer__rotateY: 0,
                        __framer__perspective: 1200,
                    }, React.createElement(Badge)))
                })
        })()
    </script>
    
    <!-- End of bodyEnd -->
</body>
</html>
